#
fn main() -> glib::ExitCode { // Create a new application let app = Application::builder().application_id(APP_ID).build(); // Connect to "activate" signal of `app` app.connect_activate(build_ui); // Run the application app.run()
} fn build_ui(application: &Application) { // Create two buttons let button_increase = Button::builder() .label("Increase") .margin_top(12) .margin_bottom(12) .margin_start(12) .margin_end(12) .build(); let button_decrease = Button::builder() .label("Decrease") .margin_top(12) .margin_bottom(12) .margin_start(12) .margin_end(12) .build(); // A mutable integer let mut number = 0; // Connect callbacks // When a button is clicked, `number` should be changed button_increase.connect_clicked(|_| number += 1); button_decrease.connect_clicked(|_| number -= 1); // Add buttons to `gtk_box` let gtk_box = gtk::Box::builder() .orientation(Orientation::Vertical) .build(); gtk_box.append(&button_increase); gtk_box.append(&button_decrease); // Create a window let window = ApplicationWindow::builder() .application(application) .title("My GTK App") .child(&gtk_box) .build(); // Present the window window.present();
} Here we would like to create a simple app with two buttons. If we click on one button, an integer number should be increased. If we press the other one, it should be decreased. The Rust compiler refuses to compile it though. For once the borrow checker kicked in: error[E0499]: cannot borrow `number` as mutable more than once at a time --> main.rs:27:37 |
26 | button_increase.connect_clicked(|_| number += 1); | ------------------------------------------------ | | | | | | | first borrow occurs due to use of `number` in closure | | first mutable borrow occurs here | argument requires that `number` is borrowed for `'static`
27 | button_decrease.connect_clicked(|_| number -= 1); | ^^^ ------ second borrow occurs due to use of `number` in closure | | | second mutable borrow occurs here Also, the compiler tells us that our closures may outlive number: error[E0373]: closure may outlive the current function, but it borrows `number`, which is owned by the current function --> main.rs:26:37 |
26 | button_increase.connect_clicked(|_| number += 1); | ^^^ ------ `number` is borrowed here | | | may outlive borrowed value `number` |
note: function requires argument type to outlive `'static` --> main.rs:26:5 |
26 | button_increase.connect_clicked(|_| number += 1); | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^
help: to force the closure to take ownership of `number` (and any other referenced variables), use the `move` keyword |
26 | button_increase.connect_clicked(move |_| number += 1); | ^^^^^^^^ Thinking about the second error message, it makes sense that the closure requires the lifetimes of references to be 'static. The compiler cannot know when the user presses a button, so references must live forever. And our number gets immediately deallocated after it reaches the end of its scope. The error message is also suggesting that we could take ownership of number. But is there actually a way that both closures could take ownership of the same value? Yes! That is exactly what the Rc type is there for. The Rc counts the number of strong references created via Clone::clone and released via Drop::drop , and only deallocates it when this number drops to zero. We call every object containing a strong reference a shared owner of the value. If we want to modify the content of our Rc , we can use the Cell type. The Cell class is only suitable for objects that implement the Copy trait. For other objects, RefCell is the way to go. You can learn more about interior mutability in this section of the book Rust Atomics and Locks . Filename: listings/g_object_memory_management/1/main.rs # use std::cell::Cell;
