We now got comfortable using callbacks, but how do they actually work? All of this happens asynchronously, so there must be something managing the events and scheduling the responses. Unsurprisingly, this is called the main event loop. The main loop manages all kinds of events — from mouse clicks and keyboard presses to file events. It does all of that within the same thread. Quickly iterating between all tasks gives the illusion of parallelism. That is why you can move the window at the same time as a progress bar is growing. However, you surely saw GUIs that became unresponsive, at least for a few seconds. That happens when a single task takes too long. Let's look at one example. Filename: listings/main_event_loop/1/main.rs use std::time::Duration; use gtk::prelude::*;
use gtk::{self, glib, Application, ApplicationWindow, Button}; const APP_ID: &str = "org.gtk_rs.MainEventLoop1"; fn main() -> glib::ExitCode { // Create a new application let app = Application::builder().application_id(APP_ID).build(); // Connect to "activate" signal of `app` app.connect_activate(build_ui); // Run the application app.run()
} fn build_ui(app: &Application) { // Create a button let button = Button::builder() .label("Press me!") .margin_top(12) .margin_bottom(12) .margin_start(12) .margin_end(12) .build(); // Connect to "clicked" signal of `button` button.connect_clicked(move |_| { // GUI is blocked for 5 seconds after the button is pressed let five_seconds = Duration::from_secs(5); std::thread::sleep(five_seconds); }); // Create a window let window = ApplicationWindow::builder() .application(app) .title("My GTK App") .child(&button) .build(); // Present window window.present();
} After we press the button, the GUI is completely frozen for five seconds. We can't even move the window. The sleep call is an artificial example, but it is not unusual wanting to run a slightly longer operation in one go.

