Until now, whenever we constructed pre-defined widgets we relied on the builder pattern . As a reminder, that is how we used it to build our trusty "Hello World!" app. Filename: listings/hello_world/3/main.rs use gtk::prelude::*;
use gtk::{glib, Application, ApplicationWindow, Button};
const APP_ID: &str = "org.gtk_rs.HelloWorld3"; fn main() -> glib::ExitCode { // Create a new application let app = Application::builder().application_id(APP_ID).build(); // Connect to "activate" signal of `app` app.connect_activate(build_ui); // Run the application app.run()
} fn build_ui(app: &Application) { // Create a button with label and margins let button = Button::builder() .label("Press me!") .margin_top(12) .margin_bottom(12) .margin_start(12) .margin_end(12) .build(); // Connect to "clicked" signal of `button` button.connect_clicked(|button| { // Set the label to "Hello World!" after the button has been clicked on button.set_label("Hello World!"); }); // Create a window let window = ApplicationWindow::builder() .application(app) .title("My GTK App") .child(&button) .build(); // Present window window.present();
} A video which shows that pressing on a button changes its label Creating widgets directly from code is fine, but it makes it harder to separate the logic from the user interface. This is why most toolkits allow to describe the user interface with a markup language and GTK is no exception here. For example the following xml file describes the window widget of the "Hello World!" app. Filename: listings/composite_templates/1/resources/window.ui <?xml version="1.0" encoding="UTF-8"?>
<interface> <template class="MyGtkAppWindow" parent="GtkApplicationWindow"> <property name="title">My GTK App</property> <child> <object class="GtkButton" id="button"> <property name="label">Press me!</property> <property name="margin-top">12</property> <property name="margin-bottom">12</property> <property name="margin-start">12</property> <property name="margin-end">12</property> </object> </child> </template>
</interface> The most outer tag always has to be the <interface>. Then you start listing the elements you want to describe. In order to define a composite template, we specify the name MyGtkAppWindow of the custom widget we want to create and the parent gtk::ApplicationWindow it derives of. These xml files are independent of the programming language, which is why the classes have the original names. Luckily, they all convert like this: gtk::ApplicationWindow → GtkApplicationWindow. Then we can specify properties which are listed here for ApplicationWindow. Since ApplicationWindow can contain other widgets we use the <child> tag to add a gtk::Button. We want to be able to refer to the button later on so we also set its id.

