By now, we've already learned many ways to glue our widgets together. We can send messages through channels, emit signals, share reference-counted state and bind properties. Now, we will complete our set by learning about actions. An action is a piece of functionality bound to a certain GObject. Let's check out the simplest case where we activate an action without a parameter. Filename: listings/actions/1/main.rs # use gio::SimpleAction;
# use glib::clone;
# use gtk::prelude::*;
# use gtk::{gio, glib, Application, ApplicationWindow};
# # const APP_ID: &str = "org.gtk_rs.Actions1";
# # fn main() -> glib::ExitCode {
# // Create a new application
# let app = Application::builder().application_id(APP_ID).build();
# # // Connect to "activate" signal of `app`
# app.connect_activate(build_ui);
# # // Set keyboard accelerator to trigger "win.close".
# app.set_accels_for_action("win.close", &["<Ctrl>W"]);
# # // Run the application
# app.run()
# }
# fn build_ui(app: &Application) { // Create a window and set the title let window = ApplicationWindow::builder() .application(app) .title("My GTK App") .width_request(360) .build(); // Add action "close" to `window` taking no parameter let action_close = SimpleAction::new("close", None); action_close.connect_activate(clone!(@weak window => move |_, _| { window.close(); })); window.add_action(&action_close); // Present window window.present();
} First, we created a new gio::SimpleAction which is named "close" and takes no parameter. We also connected a callback which closes the window. Filename: listings/actions/1/main.rs # use gio::SimpleAction;
