# window.close();
# }));
# window.add_action(&action_close);
# # // Present window
# window.present();
# } One of the most popular reasons to use actions are keyboard accelerators, so we added one here. With set_accels_for_action one can assign one or more accelerators to a certain action. Check the documentation of accelerator_parse in order to learn more about its syntax. Before we move on to other aspects of actions, let's appreciate a few things that are curious here. The "win" part of "win.close" is the group of the action. But how does GTK know that "win" is the action group of our window? The answer is that it is so common to add actions to windows and applications that there are already two predefined groups available: "app" for actions global to the application, and "win" for actions tied to an application window. If that had not been the case, we would have to add the action group manually via gio::SimpleActionGroup . Filename: listings/actions/2/main.rs # use gio::SimpleAction;
