# fn build_ui(app: &Application) { let original_state = 0; let label = Label::builder() .label(format!("Counter: {original_state}")) .build(); // Create a button with label let button = Button::builder().label("Press me!").build(); // Connect to "clicked" signal of `button` button.connect_clicked(move |button| { // Activate "win.count" and pass "1" as parameter let parameter = 1; button .activate_action("win.count", Some(&parameter.to_variant())) .expect("The action does not exist."); }); // Create a `gtk::Box` and add `button` and `label` to it let gtk_box = gtk::Box::builder() .orientation(Orientation::Vertical) .margin_top(12) .margin_bottom(12) .margin_start(12) .margin_end(12) .spacing(12) .halign(Align::Center) .build(); gtk_box.append(&button); gtk_box.append(&label); // Create a window, set the title and add `gtk_box` to it let window = ApplicationWindow::builder() .application(app) .title("My GTK App") .width_request(360) .child(&gtk_box) .build(); // Add action "count" to `window` taking an integer as parameter let action_count = SimpleAction::new_stateful( "count", Some(&i32::static_variant_type()), original_state.to_variant(), ); action_count.connect_activate(clone!(@weak label => move |action, parameter| { // Get state let mut state = action .state() .expect("Could not get state.") .get::<i32>() .expect("The variant needs to be of type `i32`."); // Get parameter let parameter = parameter .expect("Could not get parameter.") .get::<i32>() .expect("The variant needs to be of type `i32`."); // Increase state by parameter and store state state += parameter; action.set_state(state.to_variant()); // Update label with new state label.set_label(&format!("Counter: {state}")); })); window.add_action(&action_count); // Present window window.present();
} Here we created a "win.count" action that increases its state by the given parameter every time it is activated. It also takes care of updating the label with the current state. The button activates the action with each click while passing "1" as parameter. This is how our app works: A video which shows that pressing on one button also changes the label below

