If you want to create a menu you have to use actions and you will want to use the interface builder. Typically, a menu entry has an action fitting one of these three descriptions: no parameter and no state, or no parameter and boolean state, or string parameter and string state. Let's modify our small app to demonstrate these cases. First we extend setup_actions. For the action without parameter or state, we can use the pre-defined "window.close" action. Therefore we don't have to add anything here. With the action "sensitive-button", we manipulate the "sensitive" property of button. Here, the convention is that actions with no parameter and boolean state should behave like toggle actions. This means that the caller can expect the boolean state to toggle after activating the action. Luckily for us, that is the default behavior for gio::PropertyAction with a boolean property. Filename: listings/actions/6/window/mod.rs # mod imp;
