Now it is time to continue working on our To-Do app. One nice feature to add would be filtering of the tasks. What a chance to use our newly gained knowledge of actions! Using actions, we can access the filter via the menu as well as via keyboard shortcuts. This is how we want this to work in the end: A video which shows a more featureful To-Do app/p&gt; Note that the screencast also shows a button with label "Clear" which will remove all done tasks. This will come in handy when we later make the app preserve the tasks between sessions. Let's start by adding a menu and a header bar to window.ui. After reading the actions chapter the added code should feel familiar. Filename: listings/todo/2/resources/window.ui <?xml version="1.0" encoding="UTF-8"?> <interface>
+ <menu id="main-menu">
+ <submenu>
+ <attribute name="label" translatable="yes">_Filter</attribute>
+ <item>
+ <attribute name="label" translatable="yes">_All</attribute>
+ <attribute name="action">win.filter</attribute>
+ <attribute name="target">All</attribute>
+ </item>
+ <item>
+ <attribute name="label" translatable="yes">_Open</attribute>
+ <attribute name="action">win.filter</attribute>
+ <attribute name="target">Open</attribute>
+ </item>
+ <item>
+ <attribute name="label" translatable="yes">_Done</attribute>
+ <attribute name="action">win.filter</attribute>
+ <attribute name="target">Done</attribute>
+ </item>
+ </submenu>
+ <item>
+ <attribute name="label" translatable="yes">_Remove Done Tasks</attribute>
+ <attribute name="action">win.remove-done-tasks</attribute>
+ </item>
+ <item>
+ <attribute name="label" translatable="yes">_Keyboard Shortcuts</attribute>
+ <attribute name="action">win.show-help-overlay</attribute>
+ </item>
+ </menu> <template class="TodoWindow" parent="GtkApplicationWindow"> <property name="width-request">360</property> <property name="title" translatable="yes">To-Do</property>
+ <child type="titlebar">
+ <object class="GtkHeaderBar">
+ <child type="end">
+ <object class="GtkMenuButton" id="menu_button">
+ <property name="icon-name">open-menu-symbolic</property>
+ <property name="menu-model">main-menu</property>
+ </object>
+ </child>
+ </object>
+ </child> Then, we create a settings schema. Again, the "filter" setting correspond to the stateful actions called by the menu. Filename: listings/todo/2/org.gtk_rs.Todo2.gschema.xml <?xml version="1.0" encoding="utf-8"?>
<schemalist> <schema id="org.gtk_rs.Todo2" path="/org/gtk_rs/Todo2/"> <key name="filter" type="s"> <choices> <choice value='All'/> <choice value='Open'/> <choice value='Done'/> </choices> <default>'All'</default> <summary>Filter of the tasks</summary> </key> </schema>
</schemalist> We install the schema as described in the settings chapter Then we add a reference to settings to imp::Window. Filename: listings/todo/2/window/imp.rs # use std::cell::RefCell;
