# use serde::{Deserialize, Serialize};
# # glib::wrapper! {
# pub struct TaskObject(ObjectSubclass<imp::TaskObject>);
# }
# # impl TaskObject {
# pub fn new(completed: bool, content: String) -> Self {
# Object::builder()
# .property("completed", completed)
# .property("content", content)
# .build()
# }
# # pub fn is_completed(&self) -> bool {
# self.imp().data.borrow().completed
# }
# # pub fn task_data(&self) -> TaskData {
# self.imp().data.borrow().clone()
# }
# # pub fn from_task_data(task_data: TaskData) -> Self {
# Self::new(task_data.completed, task_data.content)
# }
# }
# #[derive(Default, Clone, Serialize, Deserialize)]
pub struct TaskData { pub completed: bool, pub content: String,
} We plan to store our data as a file, so we create a utility function to provide a suitable file path for us. We use glib::user_config_dir to get the path to the config directory and create a new subdirectory for our app. Then we return the file path. Filename: listings/todo/2/utils.rs # use std::path::PathBuf;
