impl WindowImpl for Window { fn close_request(&self) -> Inhibit { // Store task data in vector let backup_data: Vec<TaskData> = self .obj() .tasks() .snapshot() .iter() .filter_map(Cast::downcast_ref::<TaskObject>) .map(TaskObject::task_data) .collect(); // Save state to file let file = File::create(data_path()).expect("Could not create json file."); serde_json::to_writer(file, &backup_data) .expect("Could not write data to json file"); // Pass close request on to the parent self.parent_close_request() }
}
