# impl ApplicationWindowImpl for Window {} Let's it have a look into what a Vec<TaskData> will be serialized. Note that serde_json::to_writer saves the data into a more concise, but also less readable way. To create the equivalent but nicely formatted json below you can just replace to_writer with serde_json::to_writer_pretty . Filename: data.json [ { "completed": true, "content": "Task Number Two" }, { "completed": false, "content": "Task Number Five" }, { "completed": true, "content": "Task Number Six" }, { "completed": false, "content": "Task Number Seven" }, { "completed": false, "content": "Task Number Eight" }
