Of course Libadwaita is more than just a couple of stylesheets and a StyleManager . But before we get to the interesting stuff, we will make our lives easier for the future by replacing all occurrences of gtk::prelude and gtk::subclass::prelude with adw::prelude and adw::subclass::prelude . This works because the adw preludes, in addition to the Libadwaita-specific traits, re-export the corresponding gtk preludes. Now we are going let our tasks follow the boxed lists pattern . The HIG does not require us to use this style and there's a good reason for that: it is incompatible with recycling lists. This means they cannot be used with list views and are therefore only appropriate for relatively small lists. Try to add tasks programmatically and see how many of them you have to add until the UI noticeably slows down. Determine for yourself if you think that is a reasonable number or if we should have rather stuck with list views. We can use boxed lists by using gtk::ListBox instead of gtk::ListView . We will also add the boxed-list style class provided by Libadwaita. Let's implement all these changes in the window.ui file. All of the changes are confined within the second child of the ApplicationWindow. To see the complete file, just click on the link after "Filename". Filename: listings/todo/6/resources/window.ui <child> <object class="GtkScrolledWindow"> <property name="hscrollbar-policy">never</property> <property name="min-content-height">420</property> <property name="vexpand">True</property> <property name="child"> <object class="AdwClamp"> <property name="child"> <object class="GtkBox"> <property name="orientation">vertical</property> <property name="spacing">18</property> <property name="margin-top">24</property> <property name="margin-bottom">24</property> <property name="margin-start">12</property> <property name="margin-end">12</property> <child> <object class="GtkEntry" id="entry"> <property name="placeholder-text" translatable="yes">Enter a Task…</property> <property name="secondary-icon-name">list-add-symbolic</property> </object> </child> <child> <object class="GtkListBox" id="tasks_list"> <property name="visible">False</property> <property name="selection-mode">none</property> <style> <class name="boxed-list" /> </style> </object> </child> </object> </property> </object> </property> </object>
</child> In order to follow the boxed list pattern, we switched to gtk::ListBox , set its property "selection-mode" to "none" and added the boxed-list style class. Let's continue with window/imp.rs. The member variable tasks_list now describes a ListBox rather than a ListView. Filename: listings/todo/6/window/imp.rs # use std::cell::RefCell;
