Using Libadwaita on its own was already a big leap forward when it came to the look and feel of the To-Do app. Let us go one step further by adding a way to group tasks into collections. These collections will get their own sidebar on the left of the app. We will start by adding an empty sidebar without any functionality. There are a couple of steps we have to go through to get to this state. First, we have to replace gtk::ApplicationWindow with adw::ApplicationWindow . The only difference between those two is that adw::ApplicationWindow has no titlebar area. That comes in handy when we build up our interface with adw::Leaflet . In the screenshot above, the Leaflet behaves like a gtk::Box and contains the collection view on the left, a separator in the middle and the task view on the right. When using adw::ApplicationWindow the collection view and task view have their own adw::HeaderBar and the separator spans over the whole window. Filename: listings/todo/7/resources/window.ui <?xml version="1.0" encoding="UTF-8"?>
<interface> <menu id="main-menu"> <!--Menu implementation--> </menu> <template class="TodoWindow" parent="AdwApplicationWindow"> <property name="title" translatable="yes">To-Do</property> <property name="default_width">650</property> <property name="default_height">550</property> <property name="content"> <object class="AdwLeaflet" id="leaflet"> <property name="can-navigate-back">True</property> <child> <object class="GtkBox"> <!--Collection view implementation--> </object> </child> <child> <object class="AdwLeafletPage"> <property name="navigatable">False</property> <property name="child"> <object class="GtkSeparator" /> </property> </object> </child> <child> <object class="GtkBox"> <!--Task view implementation--> </object> </child> </object> </property> </template>
</interface> The Leaflet does not always behave like a gtk::Box. As soon as the requested size is too small to fit all children at the same time, the leaflet folds, and starts behaving like a gtk::Stack . This means that it only displays one of its children at a time. The property "can-navigate-back" controls whether gestures and shortcuts for navigating backward are enabled. The AdwLeafletPage with the gtk::Separator will never be displayed in the folded state since its property "navigatable" is set to False.) The adaptive behavior of the leaflet allows the To-Do app to work on smaller screen sizes even with the added collection view. A video which shows that reduzing the width of the app let's the sidebar collapse We add the necessary UI elements for the collection view, such as a header bar with a button to add a new collection, as well as the list box collections_list to display the collections later on. As you can see in the screencast above, the header bar also displays a close button if the leaflet is folded. We include this logic with an expression which can be built up in the UI file with the tag lookup . Filename: listings/todo/7/resources/window.ui <object class="GtkBox"> <property name="orientation">vertical</property> <property name="width-request">200</property> <child> <object class="AdwHeaderBar"> <binding name="show-end-title-buttons"> <lookup name="folded">leaflet</lookup> </binding> <child type="start"> <object class="GtkToggleButton"> <property name="icon-name">list-add-symbolic</property> <property name="tooltip-text" translatable="yes">New Collection</property> <property name="action-name">win.new-collection</property> </object> </child> </object> </child> <child> <object class="GtkScrolledWindow"> <property name="vexpand">True</property> <property name="child"> <object class="GtkListBox" id="collections_list"> <style> <class name="navigation-sidebar" /> </style> </object> </property> </object> </child>
</object> We also add a header bar to the task view. We don't have to worry about the close button here: it will always be displayed. However, we will need a way to go back to the collection view when the leaflet is folded. That is why we add back_button which can be used to return to the collection view and which is only visible when the leaflet is folded. Filename: listings/todo/7/resources/window.ui <object class="GtkBox"> <property name="orientation">vertical</property> <property name="hexpand">True</property> <property name="width-request">250</property> <child> <object class="AdwHeaderBar"> <property name="title-widget"> <object class="AdwWindowTitle" /> </property> <child type="start"> <object class="GtkButton" id="back_button"> <binding name="visible"> <lookup name="folded">leaflet</lookup> </binding> <property name="icon-name">go-previous-symbolic</property> <property name="tooltip-text" translatable="yes">Back</property> </object> </child> <child type="end"> <object class="GtkMenuButton"> <property name="icon-name">open-menu-symbolic</property> <property name="menu-model">main-menu</property> <property name="tooltip-text" translatable="yes">Main Menu</property> </object> </child> </object> </child> <child> <!--This part stays the same--> </child>
