Thanks to the leaflet the To-Do app folds now when we resize it to a smaller width. However, there isn't yet a way to navigate between the different leaflet pages. Let us start with the most important one: adding a new collection. A video which shows the new dialog The screencast above demonstrates the desired behavior. When we activate the button with the + symbol, a dialog appears. While the entry is empty, the "Create" button remains insensitive. As soon as we start typing, the button becomes sensitive. When we remove all typed letters and the entry becomes empty again, the "Create" button becomes insensitive and the entry gets the "error" style. After clicking the "Create" button, a new collection is created, and we navigate to its task view. To implement that behavior we will first add a "new-collection" action to the setup_actions method. This action will be activated by a click on the + button as well as on the button in the placeholder page. Filename: listings/todo/8/window/mod.rs # mod imp;
